import Layout from "../Layout/Layout";
import UserPost from "../UserPost/UserPost";

import axios from "axios";
import {useParams} from "react-router-dom";

const post1 = {
    "handle" : "@enki",
    "username" : "EnkiTheMystik",
    "date" : new Date().toDateString(),
    "content" : "Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.",
    "comments" : 1,
    "likes" : 0
}

const post2 = {
    "handle" : "@johndoe",
    "username" : "John Doe",
    "date" : new Date().toDateString(),
    "content" : "This app kind of blows tho?",
    "comments" : 0,
    "likes" : 347
}

const Home = () => {
    const url = useParams();
    let posts;

    function  getUserPosts() {
        axios.get('/getUserPosts').then((response) => {
            posts = response.data.json();
        })
    }

    return (
        <Layout>
            <UserPost handle={posts[0].handle} username={posts[0].username} date={posts[0].date} content={posts[0].content}
            comments={posts[0].comments} likes={posts[0].likes}/>
            <UserPost handle='@heavenlyyart' username='heavenlyy' date={new Date().toDateString()}
                      content={"@enki is sexy af."} comments={0} likes={5432346}/>
            <UserPost handle={post1.handle} username={post1.username} date={post1.date} content={post1.content}
                      comments={post1.comments} likes={post1.likes}/>
            <UserPost handle={post2.handle} username={post2.username} date={post2.date} content={post2.content}
                      comments={post2.comments} likes={post2.likes}/>

        </Layout>

    )
}

export default Home;
